import React from 'react';
import "./cardimp-style.css";

const Card = (props)=>{
    return(
        <React.Fragment>
            <div className="card text-center shadow" >
                <div className="overflow">
                    <img src={props.imageSrc} alt=" " className='card-img-top'/>
                </div>

            </div>
        </React.Fragment>
    )
}

export default Card;
